package baekjoon;import java.util.Deque;import java.util.LinkedList;/** * Stack 대신 Deque를 구현한 LinkedList를 사용하였으며, 이름은 stack이라고 붙임. * Stack의 push는 LinkedList의 addLast(), pop은 LinkedList의 removeLast() 사용. */public class parentheses_2504 {    public static void main(String[] args) {        Deque<String> stack = new LinkedList<>();        stack.add("1");        stack.add("2");        stack.add("3");        stack.add("4");        stack.add("5");        System.out.println(stack);        System.out.println(stack.removeLast());        System.out.println(stack);        stack.addLast("9");        System.out.println(stack);    }}